      "toggle-fpTransform": function(){ this.skewed = !this.skewed; },
      "toggle-layer": function(){ this.fpShowLayers = !this.fpShowLayers; },

          this.fp5style = "opacity:1;transition:all ease-in-out 0.6s;transform-origin:center center;transform:translate(0px,300px) scale(.5,.5) "+rot+";"
          this.fp5mstyle = "opacity:1;transition:all ease-in-out 0.6s;transform-origin:center center;transform:translate(0px,400px) scale(.5,.5) "+rot+";"
        } else {
          console.log('unlayer stuff');
          this.fp1style = "opacity:0;transition:all ease-in-out 0.6s;transform-origin:center center;transform:translate(0px,0px) scale(1.5,1.5) "+rot+";"
          this.fp1mstyle = "opacity:0;transition:all ease-in-out 0.6s;transform-origin:center center;transform:translate(0px,0px) scale(1.5,1.5) "+rot+";"
          this.fp2style = "opacity:0;transition:all ease-in-out 0.6s;transform-origin:center center;transform:translate(0px,0px) scale(1.5,1.5) "+rot+";"
          this.fp2mstyle = "opacity:0;transition:all ease-in-out 0.6s;transform-origin:center center;transform:translate(0px,0px) scale(1.5,1.5) "+rot+";"
          this.fp3style = "opacity:0;transition:all ease-in-out 0.6s;transform-origin:center center;transform:translate(0px,0px) scale(1.5,1.5) "+rot+";"
          this.fp3mstyle = "opacity:0;transition:all ease-in-out 0.6s;transform-origin:center center;transform:translate(0px,0px) scale(1.5,1.5) "+rot+";"
          this.fp4style = "opacity:1;transition:all ease-in-out 0.6s;transform-origin:center center;transform:translate(0px,0px) scale(1.5,1.5) "+rot+";"
          this.fp4mstyle = "opacity:0;transition:all ease-in-out 0.6s;transform-origin:center center;transform:translate(0px,0px) scale(1.5,1.5) "+rot+";"
          this.fp5style = "opacity:0;transition:all ease-in-out 0.6s;transform-origin:center center;transform:translate(0px,0px) scale(1.5,1.5) "+rot+";"
          this.fp5mstyle = "opacity:0;transition:all ease-in-out 0.6s;transform-origin:center center;transform:translate(0px,0px) scale(1.5,1.5) "+rot+";"
        }
      },
      skewedChanged: function(){
        this.fpShowLayersChanged();
      }
